import React, { Component } from 'react'

export default class Landing extends Component {
    render() {
        return (
            <div className="landing">
                <div className="hello">
                    <h1 className="hero">Jambo!!</h1>
                    <h2 className="hero">Need to take your business elsewhere?</h2>
                    <span>Caption to direct on the internet</span>
                </div>
                <div>
                    <button className="buton">Learn More</button>
                </div>
                <div className="image-capture">
                    <img src="" alt=""/>
                </div>
            </div>
        )
    }
}
